import React, { useState } from "react";
import "./Navbar.css";
import { Navigate, useNavigate } from "react-router-dom";

const Navbar = (menu1, menu2, link1, link2, username) => {
    const [isOpen, setIsOpen] = useState(false);
    // const [menu1, menu2] = props;
    const navigate = useNavigate();
    const toggleMenu = () => {
        setIsOpen(!isOpen);
    };
    const forlink = (link) => {
        navigate(link)
    }
    return (
        <div className="bunner">
            {/* ライン */}
            <div className="horizontal-line">
                <div className="tagName">
                    SkyGallery
                </div>
            </div>
            <div className="displayUserName">
                {username}
            </div>
            {/* ハンバーガーメニュー */}
            <div className="hamburger-menu">
                <button className="menu-button" onClick={toggleMenu}>
                    ☰
                </button>
                {isOpen && (
                    <div className="menu">
                        <button className="menu1" onClick={() => { forlink(link1) }}>{menu1}</button>
                        <button className="menu1" onClick={() => { forlink(link2) }}>{menu2}</button>
                    </div>
                )}
            </div>
        </div>
    );
};

export default Navbar;
